import Link from "react-router-dom";

export default function Header() {
    return (
        <nav className="headerNav">
            <div className="logoContainer">
                <Link to="/">
                    <img src="" />
                </Link>
            </div>
            <div className="headerMenu"></div>
        </nav>
    );
}
